import styled from 'styled-components';
import SignIn from '../components/SignIn';
import SignUp from '../components/SignUp';

const GridStyles = styled.div``;

const SignInPage = () => (
  <GridStyles>
    <SignIn />
    <SignUp />
  </GridStyles>
);

export default SignInPage;
